from itertools import islice
from typing import List, Any, Union

from scapy.all import *
import matplotlib.pyplot as plt
import pandas as pd


def logistic(b, x, x0):
    if -b * (x - x0) > 100:
        logic = 1
    else:
        logic = 1 / (1 + math.e ** (-b * (x - x0)))
    return logic


def list_average(lst):
    if len(lst) == 0:
        return 0
    else:
        return sum(lst) / len(lst)


def lastNvalues(lst, N):
    res = list(islice(reversed(lst), 0, N))
    res.reverse()
    return res


def lastNaverage(lst, N):
    return list_average(lastNvalues(lst, N))


def anomalydetection(timeseries):
    predicted = timeseries[0]
    predictions = []
    deltasAveraged = []
    logDeltasNormalized = []
    deltas = []
    anomaly = []
    currentFrame = []
    N = 20
    likelihood = 0

    for point in range(0, len(timeseries)):
        currentFrame.append(timeseries[point])
        delta = abs(timeseries[point] - predicted)

        deltas.append(delta)
        predictions.append(predicted)

        if point >= N:
            currentFrame.pop(0)

        if lastNaverage(deltas, N) == 0:
            anomaly.append(0)
            deltasAveraged.append(0)
            logDeltasNormalized.append(0)
        else:
            deltasAveraged.append(logistic(4, delta / lastNaverage(deltas, N), 2.5))
            if lastNaverage(logDeltasNormalized, N) == 0:
                logDeltaNormalized = 0.01
            else:
                logDeltaNormalized = logistic(6 / lastNaverage(logDeltasNormalized, N), deltasAveraged[point], lastNaverage(logDeltasNormalized, N))

            likelihood = logistic(5, likelihood + logDeltaNormalized, 1)
            logDeltasNormalized.append(logDeltaNormalized)
            anomaly.append(likelihood)

        predicted = 0.8 * timeseries[point] + 0.2 * predicted

    return anomaly, deltas, deltasAveraged, logDeltasNormalized, predictions


def get_anomaly(timeseries, name):
    timerange = []
    for i in range(0, len(timeseries)):
        timerange.append(i)

    anomaly, deltas, deltasAveraged, logDeltasNormalized, predictions = anomalydetection(timeseries)

    threshold = 0.8
    adots = []
    xdots = []

    # defining anomaly dots for both X and Anomaly indicator series
    for i in range(0, len(deltasAveraged)):
        if anomaly[i] >= threshold:
            xdots.append(timeseries[i-1])
            adots.append(anomaly[i])
        else:
            xdots.append(None)
            adots.append(None)

    xdots.pop(0)
    xdots.append(None)

    # fig, (sp1, sp2, sp3, sp4) = plt.subplots(4, 1, figsize=(10, 10))
    fig, (sp1, sp2, sp3) = plt.subplots(3, 1, figsize=(10, 10))
    fig.suptitle('Delta for initial series')
    sp1.title.set_text('Initial series')
    sp2.title.set_text('Delta')
    # sp3.title.set_text('Delta Averaged')
    # sp3.title.set_text('Delta Normalized')
    sp3.title.set_text('Anomaly likelihood')
    fig.tight_layout()
    fig.subplots_adjust(left=None, bottom=None, right=0.95, top=0.9, wspace=None, hspace=0.25)

    sp1.plot(timerange, timeseries, '-')
    sp1.plot(timerange, xdots, 'r.')
    sp1.plot(timerange, predictions, ':', color="gray")
    sp2.plot(timerange, deltas, '-', color="silver")
    # sp22 = sp2.twinx()
    # sp22.set_ylim(0, 1.0)
    # sp22.plot(timerange, anomaly, ':', color="gray")
    sp3.set_ylim(0, 1.0)
    # sp3.plot(timerange, anomaly, 'tab:grey')
    sp3.plot(timerange, anomaly, '-', color="silver")
    sp3.plot(timerange, adots, 'r.')

    # plt.savefig(name + '.png', dpi=1200)
    plt.show()


